use std::fs::File;
use std::io::Write;
use std::path::PathBuf;

pub fn fpath(vecstr: Vec<&str>) -> String {
    let p: PathBuf = vecstr.iter().collect();
    p.into_os_string().into_string().unwrap()
}

pub fn write_sample_file(path: &str, what: &str) -> Result<(), String> {
    let mut fname = "";
    let mut sample = "";

    match what {
        "dat" => {
            sample = SAMPLE_DAT;
            fname = "sample_data.csv"
        }
        "lim" => {
            sample = SAMPLE_LIM;
            fname = "sample_limits.csv"
        }
        "cfg" => {
            sample = SAMPLE_CFG;
            fname = "sample_config.csv"
        }
        _ => (),
    }

    let p = fpath(vec![path, fname]);
    let mut file = match File::create(&p) {
        Ok(f) => f,
        Err(e) => return Err(format!("cannot open file '{}', '{}'", p, e)),
    };

    match writeln!(&mut file, "{}", sample) {
        Ok(_) => (),
        Err(e) => return Err(format!("cannot write to file '{}', '{}'", p, e)),
    };
    println!("Sample {} file '{}' written.", what, p);
    Ok(())
}

pub fn help(prognam: &str) -> () {
    println!(
        "USAGE:     > {} data.csv [limits.csv] [config.csv] (at least the data.csv must be provided)
        OR > {} help (to plot this help)
        OR > {} samples (to create sample_data.csv, sample_limits.csv, sample_config.csv files)
        OR > {} data.csv limits (to derive an initial limits.csv from data.csv)

         * data.csv: a CSV file in wide format containing the data
         * limits.csv: a CSV file containing limits, filters
         * config.csv: a CSV file containing settings for {}",
        prognam, prognam, prognam, prognam, prognam
    )
}

